Adora is an artist. Many artists work with us, but Adora is our only sculptor. Her sculptures are gorgeuos and huge, and she definitely uses her sense of dimension in her modeling. She's not new to artistic modeling, having posed for a number of popular websites, and it's easy to see why she is so sought after. Her light hearted personality and sparkling sense of humor make her a perfect fit for the simple, sexy, fun photography of FigureBaby.
